Knife Edge (2008) 

Verenigde Staten
Thriller

geregisseerd door Anthony Hickox
met Joan Plowright, Jamie Harris en Tamsin Egerton

Als een succesvolle jonge vrouw met haar man en haar zoontje van vijf jaar oud weer teruggaat naar Engeland om daar een nieuw leven op te starten, kopen ze een oud huis op het platteland. Al snel ontdekken ze echter dat het huis een gruwelijk geheim bevat en het duurt niet lang voor hun nieuwe leventje een gruwelijke nachtmerrie is geworden. 

